import { SoccerPlayer } from "./Components/SoccerPlayer";
import { Ball } from "./Components/ball";
import React, { useState } from "react";
import "./App.css";

import bg from "./halisaha.png";

function App() {
  let [displayMode, setDisplayMode] = useState("block");

  return (
    <div className="App">
      <header className="App-header">
        <img src={bg} />
        <SoccerPlayer displayType={displayMode}/>
        <Ball />
      </header>
    </div>
  );
}

export default App;
